import { BrowserRouter } from 'react-router-dom';
import './App.css';
import AddUser from './compoents/AddUser';
import Home from './compoents/Home';
import Navbar from './compoents/Navbar';

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Home />
      <AddUser />
    </BrowserRouter>
  );
}

export default App;
